INSERT INTO `sekolah` (`id_sekolah`, `id_user`, `id_kec`, `nama_sekolah`, `nama_kps`, `tingkat`, `email`, `nohp`, `alamat`, `visimisi`, `deskripsi`, `radius`, `bukti`, `logo`, `foto`, `longitude`, `latitude`, `created_at`, `updated_at`) VALUES
(1, 3, 2, 'SMP N 3 Terisi', 'Wahyu Hermawan, A.Md.Kom', 'SMP', 'sekolahsmp@gmail.com', '089688177247', 'Cikedung', '<p><span style=\"color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 14px; text-align: justify;\"><b>VISI</b></span></p><p><span style=\"color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 14px; text-align: justify;\">Sebagai Lembaga Pendidikan yang dapat mewujudkan peserta didik yang profesional</span></p><p><span style=\"color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 14px; text-align: justify;\"><b>MISI</b></span></p><ul><li>Meningkatkan Kualitas SDM</li><li>Meningkatkan Pelayanan Terhadap Peserta Didik</li><li>Meningkatkan Mutu Lulusan</li></ul>', '<div style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">SMP Negeri 3 Terisi dulu bernama Sekolah Lanjutan Tingkat Pertama (SLTP) Negeri 3 Cikedung yang dibuka pada tahun 1995 sebagai Kelah Jauh SLTP Negeri 1 Cikedung memiliki 2 (dua) rombongan belajar dengan jumlah siswa 96 orang. Sekolah ini bertempat di gedung eks SLTP Trisila di desa Cikedung Lor, dengan Kepala Sekolah Yth. Bp. GANDHI DANAWIDJAJA, S.Ag.</span></div>', NULL, 'bukti.pdf', 'logo.png', 'foto.jpg', '-09087787989898', '0909889898980909', '2021-07-05 15:36:58', '2021-07-09 18:34:58'),
(2, 16, 2, 'SD N 1 LELEA', 'Hyuwan', 'SD', 'sekolahsd@gmail.com', '089688', 'Mundakjaya', '<p><span style=\"color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 14px; text-align: justify;\"><b>VISI</b></span></p><p><span style=\"color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 14px; text-align: justify;\">Sebagai Lembaga Pendidikan yang dapat mewujudkan peserta didik yang profesional</span></p><p><span style=\"color: rgb(68, 68, 68); font-family: Arial, Helvetica, sans-serif; font-size: 14px; text-align: justify;\"><b>MISI</b></span></p><ul><li>Meningkatkan Kualitas SDM</li><li>Meningkatkan Pelayanan Terhadap Peserta Didik</li><li>Meningkatkan Mutu Lulusan</li></ul>', '<div style=\"text-align: justify;\"><div class=\"post_detail\" style=\"width: 750px; color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; font-size: 14px; text-align: start;\"><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">Sekolah Menengah Kejuaran Negeri 1 Lelea adalah sekolah yang di dirikan\r\npada 18 November2003 di resmikan oleh. SMK NEGERI 1 LELEA ini adalah sekolah\r\nsatu-satunya di kecamatan lelea dan mempunyai program jurusan yang berbeda\r\ndengan SMK lainya. Program jurusan yang pertama hanya ada dua yaitu:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">1. TEKNIK PENGELASAN<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">2. TATA BUSANA<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">&nbsp;Pada saat itu di pimpin oleh kepala sekolah Bapak Drs. H. Ridwan\r\nSadeli. Beliau dulunya adalah kepala sekolah SMP Negeri 1 Lelea. Beliau yang\r\nmempunyai ide buat membangun SMK&nbsp; NEGERI 1 LELEA ini<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">&nbsp;Drs.H. RIDWAN SADELI<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mulain akfit pada bulan juli 2004/2005\r\nWaktu itu masih sedikit muridnya hanya ada 2 kelas,dan belum punya gedung\r\nsendiri masih memanfaat kan Gedung bekas SD yang sudah tidak terpakai,\r\nGuru-Gurunya juga sebagian besar dari SMP Negeri 1 Lelea.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">seiring berkembangnya zaman SMK NEGERI 1 LELEA menambahkan program\r\njurusannya satu lagi yaitu:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">1.TEKNIK OTOMOTIF<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">karena TEKNIK OTOMOTIF banyak sekali peminatnya,Sebagian besar SMK yang\r\nada di wilayah INDRAMAYU ini mempunyai program jurusan ini.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">&nbsp;pada masa peneriamaan siswa baru SMK NEGERI 1 LELEA bertambah\r\nsiswanya yang tadinya 2 kelas menjadi 3 kelas, walaupun baru mempunyai bebera\r\nruang kelas. seiring bertambahnya tahun SMK NEGERI 1 LELEA semakin&nbsp; di\r\nminati oleh masyarakat buat menyekolahkan anaknya di SMK NEGERI 1 LELEA ini.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">&nbsp;pada tahun 2007 SMK NEGERI 1 LELEA bertambah lagi siswanya yang\r\ntadinya 3 kelas menjadi 6 kelas, yang di bagi menjadi 3 program jurusan,setiap\r\nprogram jurusan mempunyai 2 kelas. walaupun umur SMK ini baru 4 tahun berdiri\r\ntapi SMK ini tidak mau kalah sama SMK lainya yang sudah lama berdiri.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">&nbsp;Pada tahun 2009 Kepala sekolah SMK NEGERI 1 LELEA Bapak Drs. H .\r\nRidwan Sadeli di ganti oleh Drs. Rachmat Heriwan sampai sekarang, Bapak Drs. H.\r\nRidwan Sadeli di pindahkan ke SMK NEGERI 1 INDRAMAYU. Beliau sekarang menjadi\r\nkepala sekolah di SMK NEGERI 1 CIKEDUNG.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">&nbsp;pada tahun 2010 SMK NEGERI 1 LELEA menambahkan program jurusan dua\r\nprogram yaitu:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">1.TEKNIK KOMPUTER DAN JARINGAN<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">2. MULTIMEDIA<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">&nbsp;Jadi SMK NEGERI 1 LELEA sekarang mempunyai lima program jurusan\r\ndiantaranya:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">1.TEKNIK PENGELASAN<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">2.TATA BUSANA<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">3.TEKNIK KENDARAAN RINGAN<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">4.TEKNIK KOMPUTER DAN JARINAGAN<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">5. MULTIMEDIA<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"IN\" style=\"font-size:10.5pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;\r\nmso-ansi-language:IN;mso-fareast-language:EN-ID\">6. TEKNIK OTOMASI INDUSTRI</span><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:EN-ID\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; text-align: justify; line-height: 16.5pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#444444;mso-fareast-language:\r\nEN-ID\">Guru SMK NEGERI 1 LELEA sekarang ada 46 Guru 12 PN (PEGAWAI\r\nNEGERI).&nbsp;Tata Usaha SMK NEGERI 1 LELEA sekarang ada 17 orang dan 7 PN\r\n(PEGAWAI NEGERI).<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: justify; color: rgb(68, 68, 68); margin-right: 0px; margin-bottom: 10px; margin-left: 0px; line-height: 22px; -webkit-font-smoothing: antialiased;\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p></div></div>', NULL, 'bukti.pdf', 'Windows_Settings_app_icon.png', 'lelea.jpg', '108.37243435719341', '-6.37277702202951', '2021-07-06 09:11:59', '2021-07-29 06:52:03'),
